const Sidebar = () => {
    return (
        <div className='sidebar'>
            <div className='sidebar__title'>
                <h2>Add Item</h2>
                <hr />
            </div>
            <form className='sidebar__form'>
                <label>
                    <span>Name:</span>
                    <input type='text' className='ml-3'/>
                </label>
            </form>
        </div>
    );
};

export default Sidebar;
